//Transformation de données : ici lecture d'une date sous forme d'un long et conversion vers une date en string ayant le format défini

import java.time.format.DateTimeFormatter

val to_date = udf((date: Long, numberFormat: String, destFormat: String) => {
  val possibleDate = Option(date)
  possibleDate.map(number => {
    val date = number.toString
    val formatFrom = DateTimeFormatter.ofPattern(numberFormat)
    val formatTo = DateTimeFormatter.ofPattern(destFormat)
    formatTo.format(formatFrom.parse(date))
  })
})

val destFormat = "yyyy-MM-dd"
val convertedDates = users.select(date_format(col("date_first_booking"), destFormat).as("date_first_booking"), 
             to_date(col("timestamp_first_active"), lit("yyyyMMddHHmmss"), lit(destFormat)).as("timestamp_first_active"),
             date_format(col("date_account_created"), destFormat).as("date_account_created"))

z.show(convertedDates)

// Aperçu des données qui contiennent des valeurs nulles
val filtered = users.filter("age is NULL or date_first_booking is NULL or date_account_created is NULL or timestamp_first_active is NULL or language is NULL ")
z.show(filtered)

//Recherche de corrélation

//Petit équivalent ridicule de pd.describe
users.describe().show

//Calcul du groupe d'âge de chaque utilisateur qui nous servira pour la distribution et la répartition
val ageRange = udf((age: Float) => {
    (age / 10).toInt * 10
})

val usersWithRange = usersFiltered
    .withColumn("ageRange", ageRange(col("age")))

z.show(usersWithRange)

// Répartition: "répartition" des utilisateurs selon leur appartenance à une catégorie d'âge 
// et calcul de l'âge moyen par catégorie d'âge

val ages = usersWithRange.groupBy("ageRange").agg(
    round(mean(col("age"))).as("meanAge"),
    count("age").as("Count")
    )

z.show(ages)

// Représentation visuelle avec histogramme groupés avec la répartition d'âge par genre ((bar chart: keys = ageRange, Groups: gender, Values: Count SUM)
val agesPerGender = usersWithRange.groupBy("ageRange", "gender").agg(
    round(mean(col("age"))).as("meanAge"),
    count("age").as("Count")
    )

z.show(agesPerGender)

// Résultat final de la transposition
